import React, { useState } from 'react';
import { Form, Input, Button, Upload, message, Col, Row } from 'antd';
import { UploadOutlined } from '@ant-design/icons';
import { Link } from 'react-router-dom';
import '../../Styles/FormRegisterAjustador.css';


const RegRow = () => {
    const [form] = Form.useForm();
    const [fileList, setFileList] = useState([]);

    const onFinish = async (values) => {
        console.log('Valores del formulario:', values);
        if (!values.Foto_Perfil || values.Foto_Perfil.length === 0) {
            message.error('Por favor, sube una foto de perfil.');
            return;
        }

        const formData = new FormData();
        formData.append('Nombres', values.nombres);
        formData.append('Apellidos', values.Apellidos);
        formData.append('Edad', values.Edad);
        formData.append('Sexo', values.Sexo);
        formData.append('Telefono', values.Telefono);
        formData.append('Correo_Electronico', values.Correo_Electronico);
        formData.append('Kilometraje_Inicial', values.Kilometraje_Inicial);
        formData.append('Numero_De_Llave', values.Numero_De_Llave);
        formData.append('Modelo_Vehiculo', values.Modelo_Vehiculo);
        formData.append('Placa_Vehiculo', values.Placa_Vehiculo);
        formData.append('Modelo_Celular', values.Modelo_Celular);
        formData.append('IMEI', values.IMEI);
        formData.append('Tarjeta_Gasolina', values.Tarjeta_Gasolina);
        formData.append('Foto_Perfil', values.Foto_Perfil[0].originFileObj);

        try {
            const response = await fetch('http://localhost:8000/Ajustadores/RegistrarAjustadores', {
                method: 'POST',
                body: formData
            });

            if (!response.ok) {
                throw new Error('Error en el servidor');
            }

            message.success('Usuario registrado correctamente');
            form.resetFields();
            setFileList([]);
        } catch (error) {
            console.error('Error:', error.message);
            message.error('Hubo un error al procesar la solicitud');
        }
    };

    const onFinishFailed = (errorInfo) => {
        console.error('Failed:', errorInfo);
    };

    const normFile = (e) => {
        if (Array.isArray(e)) {
            return e;
        }
        return e && e.fileList;
    };

    const uploadProps = {
        onRemove: (file) => {
            setFileList((prevList) => prevList.filter((item) => item.uid !== file.uid));
        },
        beforeUpload: (file) => {
            setFileList((prevList) => [...prevList, file]);
            return false;
        },
        fileList,
    };

    return (
   
    <div style={{backgroundColor: '#FFFFFF'}}>
        <Row justify="center" style={{ flexGrow: 1, padding:'24px'}}>
            <Col xs={24} sm={22} md={20} lg={18} xl={16}>
                <div style={{textAlign:'center'}}>
                    <img className="ImageRegAjustador" src="https://img.freepik.com/vector-gratis/personas-iconos-relacionados-seguro-automovil_53876-43023.jpg?size=626&ext=jpg&ga=GA1.1.672697106.1717804800&semt=ais_user" alt="RegisterAjustadorIcon"></img>
                </div>
                <Form
                    form={form}
                    name="basic"
                    initialValues={{ remember: true }}
                    onFinish={onFinish}
                    onFinishFailed={onFinishFailed}
                    layout="vertical"
                >

                    <Form.Item
                    label="Nombres"
                    name="nombres"
                    rules={[{ required: true, message: 'Por favor ingresa tu nombre!' }]}
                >
                    <Input />
                </Form.Item>
                <Form.Item
                    label="Apellidos"
                    name="Apellidos"
                    rules={[{ required: true, message: 'Por favor ingresa tu apellido!' }]}
                >
                    <Input />
                </Form.Item>
                <Form.Item
                    label="Edad"
                    name="Edad"
                    rules={[{ required: true, message: 'Por favor ingresa tu edad!' }]}
                >
                    <Input />
                </Form.Item>
                <Form.Item
                    label="Sexo"
                    name="Sexo"
                    rules={[{ required: true, message: 'Por favor ingresa tu sexo!' }]}
                >
                    <Input />
                </Form.Item>          
                <Form.Item
                    label="Telefono"
                    name="Telefono"
                    rules={[{ required: true, message: 'Por favor ingresa tu teléfono!' }]}
                >
                    <Input />
                </Form.Item>          
                <Form.Item
                    label="Correo_Electronico"
                    name="Correo_Electronico"
                    rules={[{ required: true, message: 'Por favor ingresa tu correo electrónico!' }]}
                >
                    <Input />
                </Form.Item>
                <Form.Item
                        label="Foto_Perfil"
                        name="Foto_Perfil"
                        valuePropName="fileList"
                        getValueFromEvent={normFile}
                        rules={[{ required: true, message: 'Por favor sube una foto de perfil!' }]}
                >
                    <Upload {...uploadProps}>
                        <Button icon={<UploadOutlined />}>Seleccionar Archivo</Button>
                    </Upload>
                </Form.Item>
                    <Form.Item
                        label="Kilometraje_Inicial"
                        name="Kilometraje_Inicial"
                        rules={[{ required: true, message: 'Por favor ingresa el kilometraje inicial!' }]}
                    >
                        <Input />
                    </Form.Item>               
                    <Form.Item
                        label="Numero_De_Llave"
                        name="Numero_De_Llave"
                        rules={[{ required: true, message: 'Por favor ingresa el número de llave!' }]}
                    >
                        <Input />
                    </Form.Item>   
                
                    <Form.Item
                        label="Modelo_Vehiculo"
                        name="Modelo_Vehiculo"
                        rules={[{ required: true, message: 'Por favor ingresa el modelo del vehículo!' }]}
                    >
                        <Input />
                    </Form.Item>  
                    <Form.Item
                        label="Placa_Vehiculo"
                        name="Placa_Vehiculo"
                        rules={[{ required: true, message: 'Por favor ingresa la placa del vehículo!' }]}
                    >
                        <Input />
                    </Form.Item> 


                    <Form.Item
                        label="Modelo_Celular"
                        name="Modelo_Celular"
                        rules={[{ required: true, message: 'Por favor ingresa el modelo del celular!' }]}
                    >
                        <Input />
                    </Form.Item> 
                    <Form.Item
                        label="IMEI"
                        name="IMEI"
                        rules={[{ required: true, message: 'Por favor ingresa el IMEI!' }]}
                    >
                        <Input />
                    </Form.Item>             

                    <Form.Item
                        label="Tarjeta_Gasolina"
                        name="Tarjeta_Gasolina"
                        rules={[{ required: true, message: 'Por favor ingresa el número de la tarjeta de gasolina!' }]}
                    >
                        <Input />
                    </Form.Item>

                    <Form.Item>
                        <Button type="primary" htmlType="submit">
                            Registrar
                        </Button>
                    </Form.Item>


                    <Link to="/VerAjustadores">
                    <Button type="primary">Ir a Login</Button>
                    </Link>
                </Form>
            </Col>
        </Row>


    </div>

    );
};

export default RegRow;
